@dataclass(frozen=False)
class Candle:
    open_price: float
    high_price: float
    low_price: float
    close_price: float
    volume: int

    def __init__(self, trade_price, volume):
        self.open_price = trade_price
        self.high_price = trade_price
        self.low_price = trade_price
        self.close_price = trade_price
        self.volume = volume

    def reset(self, trade_price):
        self.open_price = trade_price
        self.high_price = 0.0
        self.low_price = 9999999999.999
        self.close_price = 0.0
        self.volume = 0

    def process(self, tick: Tick):
        if self.high_price < tick.last_price:
            self.high_price = tick.last_price
        if self.low_price > tick.last_price:
            self.low_price = tick.last_price
        self.close_price = tick.last_price
        self.volume += tick.last_quantity


class FormCandle:
    def __init__(self):
        self.current_hour = 0
        self.current_minute = 0
        self.candle = None

    def __is_reset(self, tick: Tick):
        if self.current_hour == 0:
            self.current_hour = tick.last_trade_time.hour
            self.current_minute = tick.last_trade_time.minute
            return False

        if tick.last_trade_time.hour != self.current_hour or tick.last_trade_time.minute != self.current_minute:
            return True

        return False

    def process(self, tick: Tick):
        """ process ticks and form candles - return only when time period is met"""

        if self.candle is None:
            self.candle = Candle(tick.last_price, tick.last_quantity)

        self.candle.process(tick)

        # return candle when the time period condition is met 
        if self.__is_reset(tick):
            duplicate_candle = copy.deepcopy(self.candle)
            self.candle.reset(tick.last_price)
            return duplicate_candle
        return None

